import React from 'react';

const Rating = ({ item, handleRatingSubmit }) => {
    return (
        <div>
            <p className="card-text">ID: {item.id}</p>

            {/* Inline Rating Form */}
            <form
                onSubmit={(e) => handleRatingSubmit(e, item.id)}
                className="d-flex align-items-center"
                style={{ gap: "0.5em" }}
            >
                <label htmlFor={`ratingValue-${item.id}`} className="mb-0">
                    Rate:
                </label>
                <input
                    type="number"
                    id={`ratingValue-${item.id}`}
                    name="ratingValue"
                    min="1"
                    max="5"
                    required
                    className="form-control"
                    style={{ width: "50px" }}
                />
                <button type="submit" className="btn btn-primary btn-sm">
                    Submit
                </button>
            </form>
        </div>
    );
};

export default Rating;
